    }

    onInputChange = (event) => {
        console.log(event.target.value);
    }

    onButtonSubmit = () => {
        console.log('click');

    }

    render() { 
        return (
            <div className="App">
                <ParticlesBg className='particles' num={200} type="cobweb" bg={true} />
                <Navigation />
                <Logo />
                <Rank />
                <ImageLinkForm 
                    onInputChange={this.onInputChange} 
                    onButtonSubmit={this.onButtonSubmit}
                />
                <FaceRecognition />       
           </div>
    );
  }
}
export default App;
